import Movies from '../components/movies';


function Search() {


    return (

        <div class="movies-container" >

          {
            data.map((movie) => {
                return (

                  <Movies  
                    key = {movie.id}
                    movieID = { movie.id.toString() } 
                    adult = { movie.adult }
                    url = { posterUrl }
                    image = { movie.poster_path } 
                    title = { movie.title }
                    releaseDate = { movie.release_date }
                    overview = { movie.overview }
                    ></Movies>
                )


            })
          } 

         </div>

    )

}

export default Search;
